import React, { Component } from "react";
import Contact from "./Contact";

class Contacts extends Component {
  constructor() {
    super();
    this.state = {
      aqib: [
        {
          name: "John Deho",
          email: "saqib68@gmail.com",
          phone: "123-258-0525"
        },
        {
          name: "Karen Smith",
          email: "Karan.Smith@gmail.com",
          phone: "123-258-0525"
        },
        {
          name: "Jana Smith",
          email: "Jana.smith@gmail.com",
          phone: "123-258-0525"
        }
      ]
    };
  }
  render() {
    const { aqib } = this.state;
    return (
      <div>
        {aqib.map(sam => (
          <Contact
            key={sam.id}
            name={sam.name}
            email={sam.email}
            phone={sam.phone}
          />
        ))}
      </div>
    );
  }
}

export default Contacts;
